import React from 'react';
import './App.css';

function App() {

  return (
    <div>
        <form action="">
            <h1 >Оставь заявку</h1>
            <input type="email" placeholder='Введите eMail'/>
            <input type='name' placeholder='Ввелите Name'/>
        </form>

    </div>
  );
}

export default App;
